import React from 'react';

const HabitCard = ({ habit, onComplete }) => (
    <div className="habit-card">
        <h3>{habit.title}</h3>
        <p>{habit.description}</p>
        <p>World: {habit.world}</p>
        <button onClick={() => onComplete(habit._id)} disabled={habit.completed}>
            {habit.completed ? 'Completed' : 'Mark as Complete'}
        </button>
    </div>
);

export default HabitCard;
